="job-description profile"> <h3>Dein Profil</h3> <ul><li>Du hast die Mittlere Reife erfolgreich in der Tasche</li><li>Du sprichst und schreibst gut in deutscher Sprache</li><li>Du kannst gut planen und logisch denken</li><li>Du arbeitest gerne an unterschiedlichen Orten</li><li>Deine Zukunft willst Du selbst gestalten. Deshalb bist Du leistungs- und lernbereit</li><li>Du bist handwerklich geschickt und interessiert an Technik</li><li>Du bist motiviert, offen und gehst Dinge aus eigenem Antrieb an</li><li>Du zeigst Interesse fr Mathe und Physik</li><li>Weil zwei Hnde strker sind als eine: Teamgeist ist fr Dich eine klare Sache</li></ul> </div>	<div class="job-description services"> <h3>Wir bieten Dir</h3> <ul><li>Mit uns in die Zukunft: Du arbeitest in einem hochwertigen, modernen Umfeld</li><li>Gem dem Rahmenplan der Industrie- und Handelskammer kannst Du von uns eine umfassende Berufsausbildung im dualen System erwarten</li><li>Ein innovatives Familienunternehmen bringt viel Gutes mit sich: freu Dich auf abwechslungsreiche und verantwortungsvolle Ttigkeiten</li><li>Erfahrene Ausbilder begleiten Dich whrend Deiner Ausbildung. Sie vermitteln Dir alle notwendigen Grundlagen, um danach erfolgreich durchzustarten</li><li>Fehler sind zum Lernen da: Wir arbeiten nach dem Prinzip einer positiven Fehler Kultur</li><li>In unserem offenen, kollegialen Miteinander und der entspannten Arbeitsatmosphre kannst Du Dich optimal entfalten</li><li>Profitiere von erstklassigen Trainings &amp; Fachseminaren unserer MACK Akademie</li><li>Nutze die Mglichkeit auf Untersttzung durch das Programm AhA! (Azubis helfen Azubis - kostenlose Nachhilfe)</li><li>Geniee die Sicherheit, Vertrauen entgegengebracht zu bekommen und fr Deine Arbeit &amp; Persnlichkeit geschtzt zu werden</li><li>Snacken, Quatschen, Kennenlernen: regelmige Azubi-Treffen mit gemeinsamem Essen</li><li>Der Azubi-Ausflug bringt als Jahreshighlight jede Menge Spa ins Team</li></ul> </div>	Cynthia Ziegler	07822 77 15400	Cynthia